import React from "react";
import { View, Text, Button } from "../../styles/style";
import { ImageBackground, TouchableHighlight } from "react-native";
import { useNavigation } from "@react-navigation/native";
import { StackTypes } from "../../routes/stack";
import styled from "styled-components/native";

const Login = () => {
  const navigation = useNavigation<StackTypes>();

  return (
    <View>
      <BackgroundImage
        source={{
          uri: "https://i.pinimg.com/originals/53/24/d2/5324d2ecdbba24066ae8d85df2b7f207.jpg",
        }}
        resizeMode="cover"
      >
        <TouchableHighlight
          style={{ justifyContent: "center", alignItems: "center" }}
        >
          <Container>
            <EntrarLabel>Entre agora</EntrarLabel>
          </Container>
        </TouchableHighlight>
      </BackgroundImage>
    </View>
  );
};

const Container = styled.View`
  padding: 10px 0;
  margin: 20px 0;
  width: 100%;
  background: #42aade;
`;

const EntrarLabel = styled.Text`
  text-transform: uppercase;
  font-size: 18px;
`;

const BackgroundImage = styled(ImageBackground)`
  flex: 1;
  justify-content: center;
  width: 100%;
`;

export default Login;
